import React, { Component } from "react";
import { Link } from "react-router-dom";
import Parks from "./smallparks.json";
import "./ParkPage.css";

class ParkPage extends Component {
  render() {
    let park = {
      contacts: {
        phoneNumbers: [
          {
            phoneNumber: "4358345322",
            description: "",
            extension: "",
            type: "Voice"
          },
          {
            phoneNumber: "4358344703",
            description: "",
            extension: "",
            type: "Fax"
          },
          {
            phoneNumber: "4358344747",
            description: "",
            extension: "",
            type: "TTY"
          }
        ],
        emailAddresses: [
          { description: "", emailAddress: "brca_information@nps.gov" }
        ]
      },
      states: "UT",
      directionsInfo:
        "From the North:\nTake I-15 south to UT-20 (exit 95). Travel east on UT-20 to US-89. Follow US-89 south to UT-12. Travel east on UT-12 to UT-63. Take UT-63 south to Bryce Canyon National Park.\n\nFrom the South through Zion National Park:\nTake I-15 north to UT-9 (exit 16). Follow UT-9 east through Zion National Park to US-89. Travel north on US-89 to UT-12. Go east on UT-12 to UT-63. Take UT-63 south to Bryce Canyon National Park.",
      directionsUrl: "http://www.nps.gov/brca/planyourvisit/directions.htm",
      url: "https://www.nps.gov/brca/index.htm",
      weatherInfo:
        "http://forecast.weather.gov/MapClick.php?lat=37.63&lon=-112.17#.VpUamdHUhaR",
      name: "Bryce Canyon",
      latLong: "lat:37.58399144, long:-112.1826689",
      description:
        "Hoodoos (irregular columns of rock) exist on every continent, but here is the largest concentration found anywhere on Earth. Situated along a high plateau at the top of the Grand Staircase, the park's high elevations include numerous life communities, fantastic dark skies, and geological wonders that defy description.",
      images: [
        {
          credit: "NPS Photo / Brian B. Roanhorse February 24, 2015",
          altText: "Bryce Canyon Visitor Center Toll booths in winter.",
          title: "Bryce Canyon Visitor Center Toll Booths",
          id: "3089",
          caption:
            "Opening the gates at Bryce Canyon National Park under snow.",
          url:
            "https://www.nps.gov/common/uploads/structured_data/3C7F8B29-1DD8-B71B-0B5EA38E8C5E5606.jpg"
        },
        {
          credit: "NPS Photo / Brian B. Roanhorse February 28, 2015",
          altText: "Snow on the Queens Garden Trail.",
          title: "Snow blanket On Queens Garden",
          id: "3091",
          caption: "Trail to Queens Garden is exceptional any day of the year.",
          url:
            "https://www.nps.gov/common/uploads/structured_data/3C7F8EAD-1DD8-B71B-0B080143E3A4984D.jpg"
        },
        {
          credit: "Brian B. Roanhorse March 4, 2015",
          altText: "Orange Hoodoos under snow cover.",
          title: "Mossy Cave in Winter",
          id: "3094",
          caption: "Orange is the new look at Bryce.",
          url:
            "https://www.nps.gov/common/uploads/structured_data/3C7F9378-1DD8-B71B-0B4B29598AA967F4.jpg"
        },
        {
          credit: "NPS Photo / Brian B. Roanhorse March 13, 2015",
          altText: "Early morning snow at Thor' Hammer.",
          title: "Thor's Hammer in Winter",
          id: "3095",
          caption: "Clear skys and snow drifts at Thor's Hammer.",
          url:
            "https://www.nps.gov/common/uploads/structured_data/3C7F9538-1DD8-B71B-0BA12D1447D43CE4.jpg"
        },
        {
          credit: "Photographed by Brian B. Roanhorse NPS",
          altText: "Paria View Point at Sunrise",
          title: "Paria View Point at Sunrise",
          id: "3844",
          caption: "Paria View at sunrise.",
          url:
            "https://www.nps.gov/common/uploads/structured_data/3C83D7D0-1DD8-B71B-0B799F6F8D0902D8.jpg"
        }
      ],
      designation: "National Park",
      parkCode: "brca",
      addresses: [
        {
          postalCode: "84764",
          city: "Bryce",
          stateCode: "UT",
          line1: "P.O Box 640201",
          type: "Mailing",
          line3: "",
          line2: ""
        },
        {
          postalCode: "84764",
          city: "Bryce",
          stateCode: "UT",
          line1: "Highway 63",
          type: "Physical",
          line3: "",
          line2: "Bryce Canyon National Park"
        }
      ],
      id: "6B1D053D-714F-46D1-B410-04BE868F14C1",
      fullName: "Bryce Canyon National Park"
    };
    let ParkName = park.name;
    let ParkDescription = park.description;
    let ParkMainImage = park.images[0].url;
    let PhysicalAddress = park.addresses[0].postalcode;
    let Directions = park.directionsInfo;
    let ParkImages = park.images.map(image => {
      return <img src={image.url} className="ImageBox" />;
    });
    return (
      <div className="ParkPage">
        <div className="ParkMainImageBox">
          <img className="ParkMainImage" src={ParkMainImage} />
        </div>
        <div className="ParkNameBox">
          <div className="ParkName">{ParkName}</div>
        </div>
        <div className="ParkDescriptionBox">
          <div className="ParkDescription">{ParkDescription}</div>
        </div>
        <div className="AddressBox">
          <div className="AddressHeader">Address</div>
          <div className="AddressInfo">{PhysicalAddress}</div>
        </div>
        <div className="DirectionsBox">
          <div className="DirectionsHeader">Directions</div>
          <div className="DirectionsContent">{Directions}</div>
          <div className="ReadMoreButton">Read More</div>
        </div>
        <div className="ParkImageContainer">
          <div className="ParkImageHeader">Images</div>
          <div className="ParkImageBoxes">{ParkImages}</div>
        </div>
        <div className="HomeLink">Back to Park List</div>
      </div>
    );
  }
}

export default ParkPage;
